import PropTypes from 'prop-types'
import React from 'react'

const Button = ({color,text}) => {
    const onClick =()=>{
        console.log('test');
    }
    return ( 
    <button 
    onClick ={onClick}
     style={{backgroundColor:color}} 
     className='btn'>
     {text}

    </button>

    )
}
Button.defaultProp={
    color:'blue'
}
Button.propTypes = {
    text: PropTypes.string
  }


export default Button
